import React from "react";
import NavBar from "../../components/nav-bar";
import "../../css/doctor-dashboard.css";

const DoctorDashboard = () => {
  return (
    <div className="">
      <NavBar />
      <div className="row col-12 container-fluid">
        <div className="side-menu col-3 vh-100 d-flex flex-column justify-content-center">
          <div className="side-menu-item">
            <span>Home</span>
          </div>
          <div className="side-menu-item">
            <span>Messages</span>
          </div>
          <div className="side-menu-item">
            <span>Appointments History</span>
          </div>
          <div className="side-menu-item">
            <span>Invoices</span>
          </div>
          <div className="side-menu-item">
            <span>Manage Payment Methods</span>
          </div>
          <div className="side-menu-item">
            <span>Saved Products</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default DoctorDashboard;
